import { View } from 'react-native';
import { WebView } from 'react-native-webview';
export default function News(props) {
    return (
                <View
        style={{
            overflow: 'hidden',
            maxHeight: 0,
            maxWidth: 0,
            flex: 1,
        }}>
        <WebView source={{ uri: 'https://reactnative.dev/' }} />
        </View>
    )
}
